package Relational_Operator;

public class Relational_Operators_Practice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
	int a=50;
	int b=100;
	
	System.out.println(a==b); // False
	
	System.out.println(a>b); // False
	
	System.out.println(a<b); // True
	
	System.out.println(a!=b); // True
	
	System.out.println(a<=b); // True
	
	System.out.println(a>=b); // False
		
		
		
		
	}

}
